import React from "react";
// import axios from "axios";
import { useEffect, useState } from "react";

const View = () => {
    const [items, setItemData] = useState({});
    const callItemData = async () => {
      try {
        const res = await fetch("/getitem", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        });
  
        const data = await res.json();
        console.log(data);
        setItemData(data);
      } catch (err) {
        console.log(err);
      }
    };
  
    useEffect(() => {
      callItemData();
    }, []);

  return (
    <>
      <div className="">
        <h3 className="text-center mb-3"> Testimonials View </h3>
        <table className="table table-bordered">
          <thead>
            <th style={{ width: "80px" }}> S. No </th>
            <th style={{ width: "100px" }}> Profile </th>
            <th style={{ width: "120px" }}> Name </th>
            <th> Disc </th>
            <th style={{ width: "120px" }}> Created Date </th>
            <th style={{ width: "120px" }}> Updated Date </th>
            <th style={{ width: "50px" }}> Status </th>
          </thead>
          <tbody>
            <tr></tr>
          </tbody>
        </table>
      </div>
    </>
  );
};

export default View;
